				<Link href="/">
					<a>Login</a>
				</Link>
				<Link href="/">
					<a>Store</a>
				</Link>
				<Link href="/">
					<a>Library</a>
				</Link>
				<Link href="/">
					<a>Community</a>
				</Link>
				<Link href="/">
					<a>Support</a>
				</Link>
				<Link href="/">
					<a></a>
				</Link>
			</Content>
		</Container>
	);
};

export default MobileModal;
